package cn.com.evo.integration.wasu.common.content;/** * @Description: * @author: lu.xin * @create: 2019-04-25 1:58 PM **/public class Image {    private String height;    private String type;    private String url;    private String width;    public String getHeight() {        return height;    }    public void setHeight(String height) {        this.height = height;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getUrl() {        return url;    }    public void setUrl(String url) {        this.url = url;    }    public String getWidth() {        return width;    }    public void setWidth(String width) {        this.width = width;    }}